				"title": "亨特产卵",
				"image": null,
				"description": "Head down inside the Washington Monument, and activate the terminal there.  It will show you a map with 3 points on the screen. Go to each of the points in order (1, 2, 3), and salute the graves there while facing the monument.  After that - head back down into the Washington Monument at night and activate the button again. \n\nThe hunter will spawn in the area around the Monument (there are a number of possible spawn locations).  \n\nSometimes they disappear when shooting them too - potentially there's a glitch or a step is missing. Will be updated when more info is known.\n\n**Masks:** ??",
